import React, { useState, useEffect } from "react";
import "../style/Test.css";

function Test() {

    const [value, setValue] = useState(0);

    return (
        <div className="Test">
            <h1>Test Slider!!!!!11!!</h1>
            <input
                max={10}
                type="range"
                value={value}
                onChange={(e) => setValue(e.target.valueAsNumber)}
            />
        </div>
    );
  }


export default Test;
